import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import { faEnvelope } from '@fortawesome/free-solid-svg-icons'

export function IconButton(props){
    const {width=35, height=35, color="white"} = props

    return (
    <div>
        <FontAwesomeIcon icon={faEnvelope} onClick={props.click} style={{background:color, height:height, width:width}}/>
    </div>)
}
